import React from 'react'
import Card from '../card'
import { CardListContainer } from './CardListElements'


const CardList = ({ users }) => {
    return (
        <CardList>
            {users.map(user => (
                <Card user={user} key={user.id}></Card>
            ))}

        </CardList>
    )
}

export default CardList
